import React from 'react';
import "./card.css";

const Card = () => {
    return (
		<>
			<div className='done'>
				<div className='flag'></div>
				<div className='Count'></div>
				<div className='units currency'></div>
				<div className='units currency'></div>
				<div className='units currency'></div>
				<div className='units currency'></div>
				<div className='units currency'></div>
				<div className='units currency'></div>
			</div>
		</>
	);
}

export default Card;
